import React from 'react';

import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {apple} from "@fortawesome/free-brands-svg-icons";



function Intro(props){ 
    return(
        <Jumbotron className = "jumbo-fluid bg-transparent intro">
            <Container fluid={true}>
                <Row className = "justify-content-center-right">
                    <Col lg = {8} md ={10} sm = {11} xs = {12}>
                        <h1 className= "display-3 font-weight-bolder orange-gradient">{props.title}</h1>
                        <h2>{props.subTitle}</h2>
                        <br/>
                        <h4 className = "lead">{props.headlineln1}</h4>
                        <h4 className = "lead">{props.headlineln2}</h4>
                    </Col>
                </Row>
                <br />
                <Row className = "justify-content-center-right px-3">
                    <FontAwesomeIcon icon={apple} className = "social-icons"/>
                </Row>
            </Container>
        </Jumbotron>

    );
}

export default Intro;
